import React, {useState, useEffect, useRef, useContext} from 'react';
import { useNavigate } from 'react-router-dom';



const AudioPlaylist = () => {
    const [counter, setCounter] = useState(152);
    const [header, setHeader] = useState('Loading header...');
    const [data, setData] = useState([]);
    const navigate = useNavigate();

        useEffect(() => {
            fetch('https://localhost:8080/api/playList',{method:'GET',credentials:'include'})
                .then(response => response.json())
                .then(data => setData(data))
                .catch(error => console.error('Error fetching data:', error));
        }, []);
    const redirectTo=(url)=()=>{
        navigate(url)
    }



    return (
        <div>
            <h1>PlayList</h1>
            <ul>
                {data.map((item, index) => (
                    <li key={index}>{item}</li>
                ))}
            </ul>
            <button className="back_up" onClick={() => redirectTo('/')}>Назад</button>
        </div>
    );
    }
;

export default AudioPlaylist;
